    // Validate credit card number using Luhn's algorithm
    public static boolean isValidCardNumber(String cardNumber) {
        int sum = 0;
        boolean alternate = false;
        for (int i = cardNumber.length() - 1; i >= 0; i--) {
            int n = Integer.parseInt(cardNumber.substring(i, i + 1));
            if (alternate) {
                n *= 2;
                if (n > 9) {
                    n = (n % 10) + 1;
                }
            }
            sum += n;
            alternate = !alternate;
        }
        return (sum % 10 == 0);
    }

    // Validate expiration date in the format "MM/YY"
    public static boolean isValidExpirationDate(String expirationDate) {
        try {
            DateTimeFormatter formatter = DateTimeFormatter.ofPattern("MM/yy");
            LocalDate date = LocalDate.parse(expirationDate, formatter);
            LocalDate currentDate = LocalDate.now();
            return date.isAfter(currentDate);
        } catch (DateTimeParseException e) {
            return false;
        }
    }
}
